#nullable enable // autogenerated

namespace PVZEngine.Modifiers
{
    public abstract class SetModifier<T> : PropertyModifier<T>
    {
        protected SetModifier(PropertyKey<T> propertyName, SetOperator op, T constValue, int priority = 0) : base(propertyName, constValue, priority)
        {
            Operator = op;
        }

        protected SetModifier(PropertyKey<T> propertyName, SetOperator op, PropertyKey<T> buffPropertyName, int priority = 0) : base(propertyName, buffPropertyName, priority)
        {
            Operator = op;
        }
        public SetOperator Operator { get; private set; }
    }
}
